    false,nt"url": null,nt"notes": "This dataset contains case counts of asthma
    emergency department visits among Iowa residents during the year. These include
    incidents of asthma attacks, obstructive lung disease, and reactive airway disease.
    The data are stratified by month of admission, county of residence, age group, and
    gender.rnrnThe data contained in this dataset is collected by the Iowa Hospital
    Association on behalf of the Iowa Department of Public Health in accordance with
    Iowa Code section 135.166. This dataset contains confidential information. Small
    numbers suppression has been applied to data available to the public. The measures
    include Emergency Department encounters that result in inpatient admissions as well
